  false,\n\t\"url\": null,\n\t\"notes\": \"This data contains densities of fishes
  detected using mobile fisheries sonar on board the NOAA Ship Nancy Foster. The data
  were acquired in concert with a multibeam bathymetry survey of EL SECO, off the
  coast of Vieques Island, Puerto Rico in 2009. Fish densities are presented by size
  classes, corresponding to individual lengths inferred from the intensity of acoustic
  target return, in units of fish per 100 square meters.\",\n\t\"license_title\":
